76	Things to know about this demo site	[{"id": "c6629b9b-3e70-4e30-a00c-b1ab878c8df9", "type": "paragraph_block", "value": "<h2>Welcome to the Wagtail Demo Site!</h2><p>If you've gotten this far, congratulations - you're running an instance of a killer content management system written for and on top of Django, <i>the framework for perfectionists with deadlines.</i></p><p>What does Wagtail get you that Django alone does not? </p><p></p><ul><li>Focus on content creators/managers, rather than developers (but developer-friendly!)</li><li>\\"Page-centric\\" content modeling</li><li>Beautiful, modern, intuitive user interface optimized for content people</li><li>Super-powerful hierarchical content management (\\"content trees\\")</li><li>User- and group-based permissions system attached to content hierarchies</li><li>Flexible image resizing with a ton of image display helpers</li><li>Innovative \\"<a href=\\"https://torchbox.com/blog/rich-text-fields-and-faster-horses/\\">StreamFields</a>\\" as an alternative to traditional \\"anything goes\\" rich text fields</li><li>Intuitive choosers for embedded Pages, Images, Documents and other content</li><li>Native integration with ElasticSearch to help you build powerful search features</li><li>Template tags to help create image renditions, smart links, and to navigate content trees</li></ul><p>If you're new to Wagtail, there are two primary paths to learning:</p><p></p><ul><li>The source code that powers this demo site</li><li>The official <a href=\\"https://docs.wagtail.org/en/stable/getting_started/index.html\\">tutorial</a></li></ul><p></p><p></p>"}]	41
