62	Yeasts, with their single-celled growth habit, can be contrasted with molds, which grow hyphae. Fungal species that can take both forms (depending on temperature or other conditions) are called dimorphic fungi ("dimorphic" means "having two forms").	[{"id": "e015f74c-47d0-4631-b768-fa20e5ec1deb", "type": "paragraph_block", "value": "<p>Yeasts are eukaryotic, single-celled microorganisms classified as members of the fungus kingdom. The yeast lineage[which?] originated hundreds of millions of years ago, and 1,500 species are currently identified.[1][2][3] They are estimated to constitute 1% of all described fungal species.[4] Yeasts are unicellular organisms which evolved from multicellular ancestors,[5] with some species having the ability to develop multicellular characteristics by forming strings of connected budding cells known as pseudohyphae or false hyphae.[6] Yeast sizes vary greatly, depending on species and environment, typically measuring 3–4 µm in diameter, although some yeasts can grow to 40 µm in size.[7] Most yeasts reproduce asexually by mitosis, and many do so by the asymmetric division process known as budding.</p><h3>Contrast with Molds</h3><p>Yeasts, with their single-celled growth habit, can be contrasted with molds, which grow hyphae. Fungal species that can take both forms (depending on temperature or other conditions) are called dimorphic fungi (\\"dimorphic\\" means \\"having two forms\\").<br/></p><p>By fermentation, the yeast species Saccharomyces cerevisiae converts carbohydrates to carbon dioxide and alcohols – for thousands of years the carbon dioxide has been used in baking and the alcohol in alcoholic beverages.[8] It is also a centrally important model organism in modern cell biology research, and is one of the most thoroughly researched eukaryotic microorganisms. Researchers have used it to gather information about the biology of the eukaryotic cell and ultimately human biology.[9] Other species of yeasts, such as Candida albicans, are opportunistic pathogens and can cause infections in humans. Yeasts have recently been used to generate electricity in microbial fuel cells,[10] and produce ethanol for the biofuel industry.<br/></p><p>Yeasts do not form a single taxonomic or phylogenetic grouping. The term \\"yeast\\" is often taken as a synonym for Saccharomyces cerevisiae,[11] but the phylogenetic diversity of yeasts is shown by their placement in two separate phyla: the Ascomycota and the Basidiomycota. The budding yeasts (\\"true yeasts\\") are classified in the order Saccharomycetales,[12] within the phylum Ascomycota.<br/></p>"}, {"id": "7e2a0b56-e8d7-46f1-920b-13a715dca209", "type": "image_block", "value": {"image": 39, "caption": "Raised Yummy", "attribution": "Creative Commons"}}]	The art of cultivating yeast	2019-01-12	21
68	Baking is a method of cooking food that uses prolonged dry heat, normally in an oven, but also in hot ashes, or on hot stones. The most common baked item is bread but many other types of foods are baked.	[{"id": "03f86cc1-3c67-4b94-872e-af9ff708e4e6", "type": "paragraph_block", "value": "<p>Heat is <b>gradually</b> transferred \\"from the surface of cakes, cookies, and breads to their centre. As heat travels through it transforms batters and doughs into baked goods with a firm dry crust and a softer centre\\".[2] Baking can be combined with grilling to produce a hybrid barbecue variant by using both methods simultaneously, or one after the other. Baking is related to barbecuing because the concept of the masonry oven is similar to that of a smoke pit.</p>"}, {"id": "7518f81f-6654-438c-8a4d-f36b3f7c27c9", "type": "image_block", "value": {"image": 24, "caption": "Soda Bread", "attribution": "Creative Commons"}}, {"id": "f245ff67-7a35-4bb0-91e5-e190ec4609d2", "type": "paragraph_block", "value": "<p>Because of historical social and familial roles, <a href=\\"https://en.wikipedia.org/wiki/Baking\\">baking</a> has traditionally been performed at home by women for domestic consumption and by men in bakeries and restaurants for local consumption. When production was industrialized, baking was automated by machines in large factories. The art of baking remains a fundamental skill and is important for nutrition, as baked goods, especially breads, are a common but important food, both from an economic and cultural point of view. A person who prepares baked goods as a profession is called a baker.</p>"}, {"id": "a3a480f6-d4e4-4f80-92c1-af97a9ee608d", "type": "image_block", "value": {"image": 12, "caption": "", "attribution": ""}}]	The art of baking	2019-02-14	22
72	Nordic bread culture has existed in Denmark, Finland, Norway, and Sweden from prehistoric time through to the present.	[{"id": "5a0af64d-01b0-4a7a-abc2-6ca6a7faab23", "type": "paragraph_block", "value": "<p>Four grain types dominated in the Nordic countries: barley and rye are the oldest; wheat and oats are more recent. During the Iron Age (500 AD – 1050 AD), rye became the most commonly used grain, followed by barley and oats. Rye was also the most commonly used grain for bread up until the beginning of the 20th century. Today, older grain types such as emmer and spelt are once again being cultivated and new bread types are being developed from these grains.</p><p>Archaeological finds in Denmark indicate use of the two triticum (wheat) species, emmer and einkorn, during the Mesolithic Period (8900 BC – 3900 BC). There is no direct evidence of bread-making, but cereals have been crushed, cooked and served as porridge since at least 4,200 BC. During the Neolithic Period (3900 BC – 1800 BC), when agriculture was introduced, barley seems to have taken over to some extent, and ceramic plates apparently used for baking are found. Moulded cereals, with water added to make a dough and baked or fried in the shape of bread, are known as burial gifts in Iron Age graves (200 AD onwards) in the Mälardalen area of central Sweden. However, it is not certain that this bread was eaten; it could just have been a burial gift. During the Bronze Age (1800 BC – 500 AD), oats and the triticum species spelt seem to have been the most commonly used grains, and we see the first real ovens, probably used for baking small loaves and perhaps the first bread (probably around 400 AD).</p><p><br/></p>"}, {"id": "103a747f-057a-4c95-9cbe-dfc57cf5107b", "type": "image_block", "value": {"image": 42, "caption": "Baking Soda", "attribution": "Creative Commons"}}, {"id": "d327ccf8-308d-4145-9f1f-0bac66a36276", "type": "paragraph_block", "value": "<p>Scandinavian soldiers in Roman times apparently learned baking techniques when working as mercenaries in the Roman army (200–400 AD). They subsequently took the technique home with them to show that they had been employed in high status work on the continent[citation needed]. Early Christian traditions promoted an interest in bread. Culturally, German traditions have influenced most of the bread types in the Nordic countries. In the eastern part of Finland, there is a cultural link to Russia and Slavic bread traditions.</p><p>In the Nordic countries, bread was the main part of a meal until the late 18th century. Four different bread regions can be found in the Nordic area in the late 19th century. In the south, soft rye bread dominated. Further north came crisp bread, usually baked with rye, then thin and crispy barley bread. In the far north, soft barley loaves dominated. During the 19th century, potatoes began to become the centrepiece of meals and bread was put aside as an extra source of carbohydrates in a meal. Bread still retained its key function for breakfast, as the open sandwich is a starter for most Nordic people today and potatoes are used as a centrepiece in lunches and dinners.</p>"}, {"id": "244a26d0-eae0-4799-8fad-ef0501bdfcff", "type": "image_block", "value": {"image": 14, "caption": "Fresh baked", "attribution": "Creative Commons"}}, {"id": "e0755385-6cf2-4b57-8612-17d5d29fadb6", "type": "paragraph_block", "value": "<p>A history of Nordic bread from around 1000 AD and some contemporary types and bread innovations is presented below. Countries are presented in alphabetic order (Denmark, Finland, Iceland, Norway and Sweden). The names of the bread types are mostly given in both the contemporary national language and in English.</p>"}]	Viking bakeries and Norse donuts	2019-03-21	23
73	During the early years of European settlement of the Americas, settlers and some groups of Indigenous peoples of the Americas used soda or pearl ash, more commonly known as potash (pot ash) or potassium carbonate, as a leavening agent (the forerunner to baking soda) in quick breads.	[{"id": "dd7625bb-2b39-4729-a1e0-55c8f43473a4", "type": "paragraph_block", "value": "<p>Since it has long been known and is widely used, the salt has many related names such as baking soda, bread soda, cooking soda, and bicarbonate of soda. In colloquial usage, the names sodium bicarbonate and bicarbonate of soda are often truncated. Forms such as sodium bicarb, bicarb soda, bicarbonate, bicarb, or even bica are common. The word saleratus, from Latin <i>sal æratus</i> meaning \\"aerated salt\\", was widely used in the 19th century for both sodium bicarbonate and potassium bicarbonate.</p>"}, {"id": "200fa9e6-d5f2-493d-bbc2-df9bdaf731b7", "type": "image_block", "value": {"image": 15, "caption": "Fresh baked", "attribution": "Creative Commons"}}, {"id": "f05234bc-2ad4-40cd-990b-36e1172b8129", "type": "paragraph_block", "value": "<p>The prefix, bi, in bicarbonate comes from an outdated naming system and is based on the observation that there is twice as much carbonate (CO3) per sodium in <a href=\\"https://en.wikipedia.org/wiki/Sodium_bicarbonate\\">sodium bicarbonate</a> (NaHCO3) as there is carbonate per sodium in sodium carbonate (Na2CO3) and other carbonates. The modern way of analyzing the situation based on the exact chemical composition (which was unknown when the name sodium bicarbonate was coined) says this the other way around: there is half as much sodium in NaHCO3 as in Na2CO3 (Na versus Na2).</p>"}, {"id": "9d78ee98-13e7-44af-89c4-3a6ed989aaf3", "type": "image_block", "value": {"image": 37, "caption": "Cornucopia of Breads", "attribution": "Creative Commons"}}]	The ingredients of traditional soda bread are flour, bread soda, salt, and buttermilk.	2019-02-08	42
74	Sandwich bread (also referred to as sandwich loaf)  is bread that is prepared specifically to be used for the preparation of sandwiches.	[{"id": "6fbdf2bd-8994-40ed-b645-959e7dbf2d1e", "type": "paragraph_block", "value": "<p>Sandwich breads are produced in many varieties, such as white, whole wheat, sourdough, rye, multigrain and others. Sandwich bread may be formulated to slice easily,[8] cleanly or uniformly, and may have a fine crumb (the soft, inner part of bread) and a light texture.[4] Sandwich bread may be designed to have a balanced proportion of crumb and crust, whereby the bread holds and supports fillings in place and reduces drips and messiness. <a href=\\"https://en.wikipedia.org/wiki/Sandwich_bread\\">Some may be designed</a> to not become crumbly, hardened, dried or have too squishy a texture.</p>"}, {"id": "244030ba-e734-4c10-a819-4abac3dfdd21", "type": "block_quote", "value": {"text": "Vegetables are a must on a diet. I suggest carrot cake, zucchini bread, and pumpkin pie.", "attribute_name": "Jim Davis"}}, {"id": "9330b160-1111-4a25-b927-ec11a5fa10aa", "type": "image_block", "value": {"image": 35, "caption": "Belgian Waffle", "attribution": "Creative Commons"}}, {"id": "ef3345bb-a75c-4723-8662-15b006dae55e", "type": "paragraph_block", "value": "<p>Sandwich bread can refer to cross-sectionally square, sliced white and wheat bread, which has been described as \\"perfectly designed for holding square luncheon meat\\".[10] The bread used for preparing finger sandwiches is sometimes referred to as sandwich bread.[10] Pan de molde is a sandwich loaf.[11][12] Some sandwich breads are designed for use in the creation of specific types of sandwiches, such as the submarine sandwich.[13] For barbecuing, use of a high-quality white sandwich bread has been described as suitable for toasting over a fire.[14] Gluten-free sandwich bread may be prepared using gluten-free flour, teff flour.[15][16] and other ingredients.<br/></p><p>In the 1930s in the United States, the term sandwich loaf referred to sliced bread.[10] In contemporary times, U.S. consumers sometimes refer to white bread such as Wonder Bread as sandwich bread and sandwich loaf.[1] Wonder Bread produced and marketed a bread called Wonder Round sandwich bread, which was designed to be used with round-shaped cold cuts and other fillings such as eggs and hamburgers, but it was discontinued due to low consumer demand.[17] American sandwich breads have historically included some fat derived from the use of milk or oil to enrich the bread.</p>"}]	Innovation in the brick oven	2019-02-02	25
77	A Boston cream pie is a yellow butter cake that is filled with custard or cream and topped with chocolate glaze.	[{"id": "b793eb57-cf99-4c2e-abc5-e3d5a8ea486b", "type": "paragraph_block", "value": "<p data-block-key=\\"2t5ek\\">Despite its name, it is in fact a cake, and not a pie.[2] The dessert acquired its name when cakes and pies were cooked in the same pans, and the words were used interchangeably.[3] In the latter part of the 19th century, this type of cake was variously called a &quot;cream pie&quot;, a &quot;chocolate cream pie&quot;, or a &quot;custard cake&quot;.[3]</p><p data-block-key=\\"3lq30\\">Owners of the Parker House Hotel in Boston claim that the Boston cream pie was first created at the hotel by Armenian-French chef M. Sanzian in 1856.[4] Called a &quot;Chocolate Cream Pie&quot;, this cake consisted of two layers of French butter sponge cake filled with crème pâtissière and brushed with a rum syrup, its side coated with crème pâtissière overlain with toasted sliced almonds, and the top coated with chocolate fondant.[5] However, historians dispute this claim to primacy; while this cake may have been served then, there is no specific contemporaneous evidence of it, and custard-filled cake was already popular at that time.[3]</p>"}, {"id": "556e76b0-0f5a-42bb-b039-653f3d6b1f0b", "type": "image_block", "value": {"image": 15, "caption": "Central Bakery", "attribution": "Creative Commons"}}, {"id": "ac48af95-b3be-4602-8c2f-5c43fc080f17", "type": "paragraph_block", "value": "<p data-block-key=\\"lhqbi\\">The cake is likely derived from the Washington pie, a two-layer yellow cake filled with jam and topped with confectioner&#x27;s sugar, for which pastry cream of custard eventually replaced the jam, and a chocolate glaze replaced the confectioner&#x27;s sugar.[2] Today, the cake is topped with a chocolate glaze (such as ganache) and sometimes powdered sugar or a cherry.</p><p data-block-key=\\"oauyc\\">The name first appeared in the 1872 Methodist Almanac.[3] Another early printed use of the term &quot;Boston cream pie&quot; occurred in the Granite Iron Ware Cook Book, printed in 1878.[2] The earliest known recipe of the modern variant was printed in Miss Parloa&#x27;s Kitchen Companion in 1887 as &quot;Chocolate Cream Pie&quot;.[2]</p><p data-block-key=\\"11hv6\\">And on another note, here are cookies baking in the oven:</p><embed embedtype=\\"media\\" url=\\"https://www.youtube.com/watch?v=ofCHfv2lOTE\\"/><p data-block-key=\\"dlchc\\"></p>"}]	Banana toffee chocolate pie?	2019-02-24	43
\.


