81	2019-03-21		Hot Cross Buns are a popular and tasty yeasted pastry traditionally served before Easter.	[{"id": "59d484e9-4be9-40bf-9a3c-f73e64b50940", "type": "paragraph_block", "value": "<p data-block-key=\\"6n9mg\\">The <a href=\\"https://en.wikipedia.org/wiki/Greeks\\">Greeks</a> in 6th century AD may have marked cakes with a cross.<a href=\\"https://en.wikipedia.org/wiki/Hot_cross_bun#cite_note-6\\">[6]</a></p><p data-block-key=\\"8rf8i\\">One theory is that the contemporary hot cross bun originates from <a href=\\"https://en.wikipedia.org/wiki/St_Albans\\">St Albans</a>, in <a href=\\"https://en.wikipedia.org/wiki/England\\">England</a>, where, in 1361, Brother Thomas Rodcliffe, a 14th-century <a href=\\"https://en.wikipedia.org/wiki/Monk\\">monk</a> at <a href=\\"https://en.wikipedia.org/wiki/St_Albans_Abbey\\">St Albans Abbey</a>, developed a similar recipe called an &#x27;Alban Bun&#x27; and distributed the bun to the local poor on Good Friday.<a href=\\"https://en.wikipedia.org/wiki/Hot_cross_bun#cite_note-7\\">[7]</a></p><p data-block-key=\\"3gg1l\\">In 1592, during the reign of <a href=\\"https://en.wikipedia.org/wiki/Elizabeth_I_of_England\\">Elizabeth I of England</a>, the London Clerk of Markets issued a decree forbidding the sale of hot cross buns and other spiced breads, except at burials, on Good Friday, or at Christmas. The punishment for transgressing the decree was forfeiture of all the forbidden product to the poor. As a result of this decree, hot cross buns at the time were primarily made in domestic kitchens. Further attempts to suppress the sale of these items took place during the reign of <a href=\\"https://en.wikipedia.org/wiki/James_I_of_England\\">James I of England</a> (1603–1625).<a href=\\"https://en.wikipedia.org/wiki/Hot_cross_bun#cite_note-8\\">[8]</a></p><p data-block-key=\\"5ursv\\">The first definite record of hot cross buns comes from a London street cry: &quot;Good Friday comes this month, the old woman runs. With one or two a penny hot cross buns&quot;, which appeared in <a href=\\"https://en.wikipedia.org/wiki/Poor_Robin\\"><i>Poor Robin&#x27;s Almanac</i></a> for 1733.<a href=\\"https://en.wikipedia.org/wiki/Hot_cross_bun#cite_note-9\\">[9]</a> The line &quot;One a penny, two a penny, hot cross-buns&quot; appears in the English nursery rhyme &quot;<a href=\\"https://en.wikipedia.org/wiki/Hot_Cross_Buns_(song)\\">Hot Cross Buns</a>&quot; published in the <a href=\\"https://en.wikipedia.org/wiki/London_Chronicle\\"><i>London Chronicle</i></a> for 2–4 June 1767.<a href=\\"https://en.wikipedia.org/wiki/Hot_cross_bun#cite_note-10\\">[10]</a> Food historian Ivan Day states, &quot;The buns were made in London during the 18th century. But when you start looking for records or recipes earlier than that, you hit nothing.&quot;</p>"}]	<p data-block-key="wnjzt">Homemade hot cross buns</p>	[{"id": "0040ce21-b4ad-4b7d-8a49-277303070c2c", "type": "paragraph_block", "value": "<p data-block-key=\\"9npzb\\">Cooking temperatures:</p>"}, {"id": "38280209-450a-4d84-b739-90c2cb19d39d", "type": "typed_table_block", "value": {"rows": [{"values": ["Gas Oven", 350.0, 180.0, "<p data-block-key=\\"6s6n5\\">14 minutes</p>"]}, {"values": ["Electric Oven", 375.0, 190.0, "<p data-block-key=\\"6s6n5\\">15 minutes</p>"]}, {"values": ["Fan Oven", 325.0, 170.0, "<p data-block-key=\\"6s6n5\\">13 minutes</p>"]}], "columns": [{"type": "text", "heading": "Oven"}, {"type": "numeric", "heading": "°F"}, {"type": "numeric", "heading": "°C"}, {"type": "rich_text", "heading": "Cooking time"}]}}, {"id": "2b9b59cb-4dd7-4ebf-ac66-1ed43471609b", "type": "table_block", "value": {"cell": [], "data": [["Buns", "Prep time", "Cooking time", "Instructions"], ["12", "30min", "1.5h", "All quantities as-is"], ["18", "40min", "2h", "1.5x all amounts"], ["24", "45min", "Depending on oven size", "2x all amounts"]], "table_caption": "Expected yield", "first_col_is_header": true, "first_row_is_table_header": true}}, {"id": "d82664ec-29e9-4095-8b53-cd5e6c262d45", "type": "paragraph_block", "value": "<h2 data-block-key=\\"7o1fp\\">Ingredients</h2><p data-block-key=\\"7jh9i\\">For the buns:</p>"}, {"id": "05dc41fe-bd09-4e88-9e52-5ed7ff8b9b96", "type": "ingredients_list", "value": [{"id": "21a44ce4-9aa6-459c-b654-d8d2217e8c8f", "type": "item", "value": "<p data-block-key=\\"softi\\">1 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Cup\\">cup</a> (240 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:ML\\">mL</a>) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Milk\\">milk</a></p>"}, {"id": "b7ca75fa-9ff9-401b-bd4e-8ca814efc8d8", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">4 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Teaspoon\\">teaspoons</a> (20 mL) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Water\\">water</a></p>"}, {"id": "8a984eeb-dc99-4f76-95e4-cc591566b73b", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">1 cake fresh <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Yeast\\">yeast</a></p>"}, {"id": "0b473c73-d8bd-41ff-97d3-4766a2caf7e2", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">3 cups (720 mL) all-purpose <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Flour\\">flour</a></p>"}, {"id": "5e68346f-b9fe-485c-8a99-ed66084bd9d4", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">⅓ cup (80 mL) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Sugar\\">sugar</a></p>"}, {"id": "7e7ceced-d961-4a73-957d-8f2d4cbbad7f", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">¼ teaspoon (1.25 mL) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Cinnamon\\">cinnamon</a></p>"}, {"id": "4a1bc81e-9158-42e2-adac-1944f52ea8fd", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">¼ teaspoon (1.25 mL) ground <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Nutmeg\\">nutmeg</a></p>"}, {"id": "ee667182-4945-43f5-a647-9a2d087f18b0", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">1 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Egg\\">egg</a> <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Beat\\">beaten</a></p>"}, {"id": "e9e70968-d2cf-43dc-948b-13f09f1af9fe", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">¼ cup (60 mL) melted <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Butter\\">butter</a></p>"}, {"id": "49b6cf74-c684-4783-b5fd-c929cc9dcb75", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">1 cup (240 mL) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Currant\\">currants</a></p>"}]}, {"id": "8e5c0d92-6131-426c-891b-af2fe90b6136", "type": "paragraph_block", "value": "<p data-block-key=\\"7o1fp\\">For the glazing:</p>"}, {"id": "b610441f-3482-4613-80cf-688b885ac199", "type": "ingredients_list", "value": [{"id": "21a44ce4-9aa6-459c-b654-d8d2217e8c8f", "type": "item", "value": "<p data-block-key=\\"softi\\">2 tbsp <a href=\\"https://en.wikibooks.org/wiki/Cookbook:All-purpose_flour\\">plain flour</a></p>"}, {"id": "c398ff9c-6bde-4535-819d-7cefe75e16f0", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">vegetable oil</p>"}, {"id": "9b08d44e-ea54-4fd1-a7ee-5a258e892eff", "type": "item", "value": "<p data-block-key=\\"a8o1o\\">1 tbsp <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Golden_Syrup\\">golden syrup</a></p>"}]}, {"id": "343c9b9a-d30f-45aa-b879-5bd3e5922565", "type": "paragraph_block", "value": "<h2 data-block-key=\\"9npzb\\">Procedure</h2><p data-block-key=\\"2m305\\">Make sure to set aside a space for the buns to rise before baking.</p>"}, {"id": "df102372-cd23-463c-b594-29b224bd409e", "type": "steps_list", "value": [{"id": "725285ae-b823-404e-8439-f5ebe3b48b31", "type": "item", "value": {"text": "<p data-block-key=\\"urko7\\">Heat milk and water to lukewarm.</p>", "difficulty": "S"}}, {"id": "8c6d544a-0f3f-4d74-bc25-af31d3430e5b", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Crumble yeast. Mix with ½ cup (120 mL) flour. Stir in tepid milk/water and mix well.</p>", "difficulty": "S"}}, {"id": "0d9383dd-b2fd-451f-ae74-9848d00b4bd1", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Cover and set aside in warm place until yeast is active and frothing, about 10-15 minutes.</p>", "difficulty": "S"}}, {"id": "1422a5d2-4ed6-4688-bc60-499222c5c4ae", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Mix remaining flour, sugar, salt, cinnamon and nutmeg.</p>", "difficulty": "S"}}, {"id": "a3cc7df9-761b-4bed-8df4-0595c57d508c", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Stir egg and butter into the yeast mix, add the flour mixture and fruit. Mix well.</p>", "difficulty": "S"}}, {"id": "664603c3-765a-444a-b88b-3189db4a7de4", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Put dough onto a floured surface and knead. Return to bowl, and let rise until double in bulk, about 1 hour.</p>", "difficulty": "L"}}, {"id": "e06bb786-75ae-4327-b9f4-9725f60e6ce0", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Turn onto a floured surface and knead again.</p>", "difficulty": "M"}}, {"id": "e356ab29-b906-4c36-a61d-146eb030b633", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Preheat oven.</p>", "difficulty": "S"}}, {"id": "8cc7055d-0125-4f3d-b8ed-9e8834d00605", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Divide dough into twelve pieces and shape into buns. Mark a deep cross on the top of each bun.</p>", "difficulty": "M"}}, {"id": "5c2a400d-8024-4865-b639-f83fa0947c72", "type": "item", "value": {"text": "<p data-block-key=\\"94uy8\\">Arrange on a baking tray, cover with tea towel, and let rise for 30 minutes. Cook in preheated oven for indicated time or until golden brown.</p>", "difficulty": "S"}}]}]
82	2019-03-21		Southern Cornbread is a hearty, unsweetened variety of cornbread, widely served in the Southeastern United States. It is easy to make and is usually served as the bread portion of lunch or dinner (supper). It is not unusual for some people to occasionally have a simple, quick meal—even breakfast—by crumbling cornbread into a glass of buttermilk and eating it.	[]		[{"id": "432fbbf5-210d-422c-ad4c-4147a205a25a", "type": "paragraph_block", "value": "<p data-block-key=\\"gv7ea\\">Ingredients:</p>"}, {"id": "4effba56-74c6-45a4-b295-a752b3121c96", "type": "ingredients_list", "value": [{"id": "af8a3379-357c-4133-9397-66df6ea6fe68", "type": "item", "value": "<p data-block-key=\\"k7zw7\\">2 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Cup\\">cups</a> yellow or white self-rising <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Cornmeal\\">corn meal</a></p>"}, {"id": "cdb5339c-49e0-43dd-ba85-cbb35d17b4a6", "type": "item", "value": "<p data-block-key=\\"wiza7\\">1 large <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Egg\\">egg</a></p>"}, {"id": "b68d5f75-8478-4e34-8fea-4b27fad06e52", "type": "item", "value": "<p data-block-key=\\"wiza7\\">1¼–1½ cups <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Buttermilk\\">buttermilk</a> or whole <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Milk\\">milk</a></p>"}, {"id": "73dcf889-97e7-4abc-b0c1-35e221747702", "type": "item", "value": "<p data-block-key=\\"wiza7\\">¼ cup <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Olive_Oil\\">olive oil</a> or <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Vegetable_oil\\">vegetable oil</a></p>"}]}, {"id": "4544593d-1ab4-49a0-833f-143f0d5434fa", "type": "paragraph_block", "value": "<p data-block-key=\\"44fqg\\">Equipment needed:</p><ul><li data-block-key=\\"9h6ph\\">well-seasoned 8-inch or 10-inch cast-iron <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Frying_Pan\\">skillet</a> (alternately: an ovenproof skillet or an 8x8-inch baking pan)</li><li data-block-key=\\"6lqtr\\">assorted measuring cups</li><li data-block-key=\\"bdset\\">medium or large mixing bowl</li></ul><p data-block-key=\\"fkooo\\">Steps:</p>"}, {"id": "65daf49f-e92b-4179-b3c3-82dd9309624f", "type": "steps_list", "value": [{"id": "8d758f80-4833-4aa0-befd-9a06f6c26575", "type": "item", "value": {"text": "<p data-block-key=\\"8x9mu\\">Preheat the oven to 425°F (220ºC). If using cast-iron skillet, place it in the oven to heat. Do not preheat other types of skillets or baking pans.</p>", "difficulty": "S"}}, {"id": "c8845f2f-f1ca-4291-a2f0-2680c47dfd5c", "type": "item", "value": {"text": "<p data-block-key=\\"yjnpj\\">If using non-cast-iron skillet or baking pan, coat with a non-stick spray.</p>", "difficulty": "S"}}, {"id": "6cd3c540-a110-4c4c-a194-b9ab60058105", "type": "item", "value": {"text": "<p data-block-key=\\"yjnpj\\">Beat egg in the bowl. Stir in buttermilk and oil.</p>", "difficulty": "M"}}, {"id": "ae73e89f-9674-486e-8df5-5db6fc430eb4", "type": "item", "value": {"text": "<p data-block-key=\\"yjnpj\\">Stir in the cornmeal and mix until just moistened. Batter will be somewhat lumpy. Take care not to overmix.</p>", "difficulty": "S"}}, {"id": "e0b41ad1-cae5-482d-ae31-f13b35f17830", "type": "item", "value": {"text": "<p data-block-key=\\"yjnpj\\">Pour the batter into the skillet and place in the oven.</p>", "difficulty": "S"}}, {"id": "7c8a44b1-38af-4d34-ac7e-ea9db44ab090", "type": "item", "value": {"text": "<p data-block-key=\\"yjnpj\\">Bake until crust is a light golden brown and a toothpick inserted into the center comes out clean. For an 8-inch skillet this can be 25–30 minutes; for a 10-inch skillet or an 8x8-inch baking pan about 20–25 minutes.</p>", "difficulty": "S"}}, {"id": "e6a607b9-f8e8-465e-a44a-26fccf9caa37", "type": "item", "value": {"text": "<p data-block-key=\\"yjnpj\\">Allow to cool for 5 minutes in pan before serving.</p>", "difficulty": "S"}}]}, {"id": "26e29d41-c99a-4fde-9423-4130089691ba", "type": "heading_block", "value": {"size": "h2", "heading_text": "Notes, tips, and variations"}}, {"id": "910c5024-a47a-45b1-a3a3-8f8bb5a8fa70", "type": "paragraph_block", "value": "<p data-block-key=\\"44fqg\\">Any leftover cornbread can be wrapped in a damp towel (to keep it moist) and stored in the refrigerator for several days. It can be frozen in storage bags for several months, but will usually become more crumbly if stored this way.</p>"}]
83	2019-03-21		Mincemeat Tarts are large (8 inch (20cm) diameter or more) open pastry tarts, sometimes with a lattice pastry top, and occasionally also containing baked or stewed apple. The smaller pastry topped tarts traditionally served at Christmas are known as Mince Pies.	[{"id": "d9f5f6c7-fd6d-4573-a1b8-40ae8209a27c", "type": "paragraph_block", "value": "<p data-block-key=\\"o28ya\\"><b>Mincemeat</b> is a mixture of chopped <a href=\\"https://en.wikipedia.org/wiki/Dried_fruit\\">dried fruit</a>, <a href=\\"https://en.wikipedia.org/wiki/Distilled_spirits\\">distilled spirits</a> and <a href=\\"https://en.wikipedia.org/wiki/Spices\\">spices</a>, and often <a href=\\"https://en.wikipedia.org/wiki/Beef_suet\\">beef suet</a>, usually used as a <a href=\\"https://en.wikipedia.org/wiki/Pie\\">pie</a> or <a href=\\"https://en.wikipedia.org/wiki/Pastry\\">pastry</a> filling. Mincemeat formerly contained <a href=\\"https://en.wikipedia.org/wiki/Meat\\">meat</a>, notably <a href=\\"https://en.wikipedia.org/wiki/Beef\\">beef</a> or <a href=\\"https://en.wikipedia.org/wiki/Venison\\">venison</a>. Many modern recipes replace the suet with vegetable <a href=\\"https://en.wikipedia.org/wiki/Shortening\\">shortening</a>. Mincemeat is found in the <a href=\\"https://en.wikipedia.org/wiki/Anglosphere\\">Anglosphere</a>.</p><p data-block-key=\\"bob35\\">Mincemeat Tarts are large (8 inch (20cm) diameter or more) open pastry tarts, sometimes with a lattice pastry top, and occasionally also containing baked or stewed apple. The smaller pastry topped tarts traditionally served at Christmas are known as Mince Pies.</p><p data-block-key=\\"966kf\\">Traditional British Mince Pies are made using shortcrust pastry.</p>"}, {"id": "79f97d63-dcaa-4d4d-b215-d9ea888c2e89", "type": "heading_block", "value": {"size": "h2", "heading_text": "Etymology"}}, {"id": "85e2ad5a-3eaa-498a-8847-0b5927ca093b", "type": "paragraph_block", "value": "<p data-block-key=\\"o28ya\\">The &quot;mince&quot; in mincemeat comes from the <a href=\\"https://en.wikipedia.org/wiki/Middle_English\\">Middle English</a> <i>mincen,</i> and the <a href=\\"https://en.wikipedia.org/wiki/Old_French\\">Old French</a> <i>mincier</i> both traceable to the <a href=\\"https://en.wikipedia.org/wiki/Vulgar_Latin\\">Vulgar Latin</a> <i>minutiare</i>, meaning <i>chop finely</i>. The word mincemeat is an adaptation of an earlier term <i>minced meat,</i> meaning finely chopped meat. Meat was also a term for food in general, not only animal flesh.</p>"}]	<p data-block-key="e4s41">Traditional British Mince Pies recipe</p>	[{"id": "cade027c-468d-4a7f-9f83-bda3d44f97ea", "type": "heading_block", "value": {"size": "h2", "heading_text": "Mincemeat ingredients"}}, {"id": "6bda536d-9ae8-4854-ad33-b1f0fd8c5858", "type": "paragraph_block", "value": "<p data-block-key=\\"c6htq\\">For 4½ <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Pint\\">pints</a> (2.25 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Liter\\">liters</a>):</p>"}, {"id": "bb7bc568-0d2b-4c5b-bab1-daca2552b4c6", "type": "ingredients_list", "value": [{"id": "9aae6b82-f49d-43dd-a824-f840443464b7", "type": "item", "value": "<p data-block-key=\\"7fbou\\">1 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Pound\\">lb</a> (500 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Gram\\">g</a>) seeded <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Raisin\\">raisins</a></p>"}, {"id": "0b8ec68c-84b5-4563-aad9-50e44b3605ad", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">1 lb (500 g) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Currant\\">currants</a></p>"}, {"id": "b52f9380-81e9-4226-9d23-6e4d496d3742", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">½ lb (250 g) finely ground beef <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Suet\\">suet</a></p>"}, {"id": "1b79e2de-929b-4eee-9623-5f277e5cb5be", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">Rind of 2 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Lemon\\">lemons</a></p>"}, {"id": "b0bf03ca-dab6-41f8-85e6-9c2c821e7584", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">½ lb (250 g) candied <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Orange\\">orange</a> peel</p>"}, {"id": "b72f7056-6421-48fa-8ba3-e650e1b27d0f", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">½ lb (250 g) candied <a href=\\"https://en.wikibooks.org/w/index.php?title=Cookbook:Citron&amp;action=edit&amp;redlink=1\\">citron</a></p>"}, {"id": "66975025-2b77-41cb-9491-d1a5305551d4", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">12 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Ounce\\">oz</a> (375 g) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Sugar\\">sugar</a></p>"}, {"id": "502c8f7c-7a03-48b4-b2d2-8c1193b64c71", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">2 lbs (1 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Kg\\">kg</a>) green <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Apple\\">apples</a>, peeled</p>"}, {"id": "a26e3eb0-4f35-4894-90dc-7e8760490b14", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">½ <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Teaspoon\\">tsp</a> (3 <a href=\\"https://en.wikibooks.org/wiki/Cookbook:ML\\">mL</a>) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Nutmeg\\">nutmeg</a></p>"}, {"id": "bac79011-9015-479d-88b6-8d60631765f8", "type": "item", "value": "<p data-block-key=\\"v5vmj\\">½ tsp (3 mL) <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Cinnamon\\">cinnamon</a></p>"}]}, {"id": "1561749c-8851-4224-a2a5-8f5aaec41ec0", "type": "paragraph_block", "value": "<p data-block-key=\\"c6htq\\">And a bit of brandy or rum if desired (recommended: ½ <a href=\\"https://en.wikibooks.org/wiki/Cookbook:Cup\\">cup</a>, 120 mL) , as well as 1tbsp of salt.</p>"}, {"id": "62fbc143-8142-42a1-b784-73122c4d7bfe", "type": "paragraph_block", "value": "<p data-block-key=\\"c6htq\\">Additional ingredients for assembly:</p><ul><li data-block-key=\\"4usn\\"><a href=\\"https://en.wikibooks.org/wiki/Cookbook:Shortcrust_Pastry\\">Shortcrust Pastry</a>, homemade or store-bought</li><li data-block-key=\\"aqohn\\"><a href=\\"https://en.wikibooks.org/wiki/Cookbook:Milk\\">Milk</a></li><li data-block-key=\\"5bb53\\"><a href=\\"https://en.wikibooks.org/wiki/Cookbook:Egg\\">Egg</a> (optional)</li></ul>"}, {"id": "c28b482e-821c-49b2-afc5-79c36e3ba4b3", "type": "heading_block", "value": {"size": "h2", "heading_text": "Procedure"}}, {"id": "2e12c587-71c0-49ff-b54f-13fbd052d2f7", "type": "table_block", "value": {"cell": [], "data": [["Oven", "°F", "°C", "Cooking time"], ["Gas", "400", "210", "18 min"], ["Electric", "425", "220", "20 min"], ["Fan", "375", "200", "16 min"]], "table_caption": "Cooking times and temperatures:", "first_col_is_header": true, "first_row_is_table_header": true}}, {"id": "f6ad5e48-660c-465c-b7d3-c5ce4703ebb8", "type": "paragraph_block", "value": "<p data-block-key=\\"yo0t8\\">Expected yield:</p>"}, {"id": "221a0da4-0b18-4345-8e4a-e4d5b25d13cc", "type": "typed_table_block", "value": {"rows": [{"values": ["1 large tart", "<p data-block-key=\\"77zjq\\">Use amounts as-is</p>"]}, {"values": ["2 small tarts", "<p data-block-key=\\"77zjq\\">Use amounts as-is</p>"]}, {"values": ["8 small mincemeat pies", "<p data-block-key=\\"77zjq\\">Use amounts as-is</p>"]}, {"values": ["16 small mincemeat pies", "<p data-block-key=\\"77zjq\\">1.5x all amounts</p>"]}], "columns": [{"type": "text", "heading": "Yield"}, {"type": "rich_text", "heading": "Instructions"}]}}, {"id": "3bd6226c-ad10-45b8-a8b9-5b677fd37b1c", "type": "heading_block", "value": {"size": "h3", "heading_text": "Mincemeat"}}, {"id": "f806364f-f7fa-48c7-8526-5e0c24233dd2", "type": "steps_list", "value": [{"id": "90b06737-b5c1-43be-9efd-d851b42df8bf", "type": "item", "value": {"text": "<p data-block-key=\\"fhzzy\\">Wash and dry currants. Set aside.</p>", "difficulty": "S"}}, {"id": "90870435-7caf-4de9-a0d2-b635d52bd26c", "type": "item", "value": {"text": "<p data-block-key=\\"2v20x\\">Put citron, orange peel, lemon rind, raisins, apples, and suet through a meat grinder using the course grinder blade.</p>", "difficulty": "S"}}, {"id": "8fc0b1b9-48d4-4bbf-84f9-166dff03ef9e", "type": "item", "value": {"text": "<p data-block-key=\\"2v20x\\">Mix in the currants, brandy, and spices.</p>", "difficulty": "S"}}, {"id": "827b830b-be21-4dcf-87c7-ecf999932de8", "type": "item", "value": {"text": "<p data-block-key=\\"2v20x\\">Store in a tightly covered plastic container in the refrigerator (do not freeze) for up to one year.</p>", "difficulty": "S"}}]}, {"id": "5b5644a1-d00c-4850-94c1-71eb7712cdb8", "type": "heading_block", "value": {"size": "h3", "heading_text": "Assembly"}}, {"id": "e819061e-a09c-4dae-b648-62afb1833451", "type": "steps_list", "value": [{"id": "90b06737-b5c1-43be-9efd-d851b42df8bf", "type": "item", "value": {"text": "<p data-block-key=\\"fhzzy\\">Let the pastry warm slightly to almost room temperature. Place on a floured cutting board and roll it out as necessary.</p>", "difficulty": "S"}}, {"id": "782977f2-d230-4e26-8289-cd7013239830", "type": "item", "value": {"text": "<p data-block-key=\\"2v20x\\">Use a doughnut cutter with the center removed or a 2½ inch round cookie cutter to cut out tart shells. Gently press into 1½ inch (4 cm) tart pans.</p>", "difficulty": "S"}}, {"id": "d1984cd2-3c26-434f-824e-0608600b68c6", "type": "item", "value": {"text": "<p data-block-key=\\"2v20x\\">Fill shells with mincemeat and top with a 1 inch (2.5 cm) round piece of pastry cut with the doughnut hole cutter. For added decoration, cut or press a design into the 1 inch pastry round before placing in the center of the filled tart.</p>", "difficulty": "M"}}, {"id": "b182ca39-999c-49ae-be6f-c32bcd011444", "type": "item", "value": {"text": "<p data-block-key=\\"2v20x\\">Lightly brush the pastry lids with milk, or a mixture of milk and beaten egg.</p>", "difficulty": "S"}}, {"id": "48e2204c-27e5-45c7-aaab-fd7756869bfd", "type": "item", "value": {"text": "<p data-block-key=\\"2v20x\\">Bake at the needed temperature for approximately 20 mins or until pastry is lightly browned at the edges.</p>", "difficulty": "S"}}, {"id": "edc4783d-fb06-4729-bab8-79ca11ce3560", "type": "item", "value": {"text": "<p data-block-key=\\"2v20x\\">Allow to cool on a wire rack, and dust with icing sugar.</p>", "difficulty": "S"}}]}, {"id": "17e9c069-9572-47e3-8df1-e6148413766a", "type": "heading_block", "value": {"size": "h2", "heading_text": "Notes, tips, and variations"}}, {"id": "02d6d181-10f9-42c0-bdae-48dd59cddf7f", "type": "paragraph_block", "value": "<ul><li data-block-key=\\"c6htq\\">If you don&#x27;t want to make your own pastry, store-bought pie crust will work well.</li><li data-block-key=\\"e9ke5\\">Candied orange peel and citron can be found in most markets around Thanksgiving.</li><li data-block-key=\\"bb50n\\">Suet is pure beef fat and can be obtained from a butcher (they will grind it on request.) Vegetarians can substitute a solid vegetable fat such as Pura Vegetable Suet.</li><li data-block-key=\\"v5vi\\">People wanting a more alcoholic kick to their Mince Pie may also want to inject them with a little extra Brandy.</li></ul>"}]
\.


